NameValue<?> smaller(NameValue<?> other) throws IOException {
  if (other.name == null) {
    if (this.name == null) {
      return null;
    }
    return this;
  } else if (this.name == null) {
    return other;
  }
  final int res = this.name.compareTo(other.name);
  if (res < 0)
    return this;
  if (res == 0)
    other.name = this.name;
  return other;
}

